/*Table structure for table `t_device_relation` */

CREATE TABLE `t_device_relation` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `divice_flag` varchar(50) NOT NULL COMMENT '企业id&大棚编号&设备编号唯一键',
  `device_id` int(11) NOT NULL COMMENT '设备编号(温度、湿度等)',
  `company_id` int(11) NOT NULL COMMENT '公司ID',
  `ground_fishpond_num` int(11) NOT NULL COMMENT '组织ID：园区内组织的唯一性。（大棚ID或渔业ID或农业ID）',
  `device_switch_num` int(11) NOT NULL DEFAULT '1' COMMENT '设备开关个数',
  `device_type` int(11) NOT NULL DEFAULT '0' COMMENT '设备类型 0农业 1渔业 2大田 3 仓库',
  `device_state` int(11) NOT NULL DEFAULT '0' COMMENT '设备状态 0正在运行  1预警 2断线',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除：0否 1是',
  `is_modify` int(11) NOT NULL DEFAULT '0' COMMENT '是否手动修改：0否 1是（解决传感器数值不准问题）',
  `modify_val` varchar(50) NOT NULL DEFAULT '' COMMENT '修改值',
  PRIMARY KEY (`id`),
  UNIQUE KEY `divice_flag` (`divice_flag`),
  KEY `company_id` (`company_id`)
