/*Table structure for table `t_f_source` */

CREATE TABLE `t_f_source` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL COMMENT '企业id',
  `fishpond_num` int(11) NOT NULL COMMENT '鱼塘编号',
  `product_name` varchar(200) NOT NULL COMMENT '产品名称',
  `product_icon` varchar(200) NOT NULL COMMENT '产品图片',
  `product_detail` varchar(200) NOT NULL COMMENT '种养产品',
  `product_type` varchar(200) NOT NULL COMMENT '品种',
  `plant_time` date NOT NULL COMMENT '种养时间',
  `season` char(1) DEFAULT NULL COMMENT '季次',
  `employee_id` int(11) NOT NULL COMMENT '负责人',
  `remarks` varchar(200) DEFAULT NULL COMMENT '备注',
  `product_information` varchar(2000) NOT NULL COMMENT '产品简介',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '0种植 1归档',
  `batch_count` int(11) NOT NULL DEFAULT '0' COMMENT '批次',
  `create_time` datetime NOT NULL COMMENT '档案创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '档案修改时间',
  `growth_pic` text COMMENT '生长期图片',
  `fish_source` text COMMENT '鱼苗来源',
  `auth_info` text COMMENT '认证信息',
  `grow_info` text COMMENT '成长记录',
  `feed_info` text COMMENT '饲料记录',
  `vaccine_info` text COMMENT '疫苗记录',
  `drug_info` text COMMENT '用药记录',
  `web_links` text COMMENT '网店链接',
  `shop_address` text COMMENT '实体店地址',
  `env_data` text COMMENT '环境数据',
  `saler` varchar(200) DEFAULT NULL COMMENT '销售人员',
  `custom` text COMMENT '自定义模块',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='鱼塘-溯源表';

/*Data for the table `t_f_source` */

insert  into `t_f_source`(`id`,`company_id`,`fishpond_num`,`product_name`,`product_icon`,`product_detail`,`product_type`,`plant_time`,`season`,`employee_id`,`remarks`,`product_information`,`state`,`batch_count`,`create_time`,`update_time`,`growth_pic`,`fish_source`,`auth_info`,`grow_info`,`feed_info`,`vaccine_info`,`drug_info`,`web_links`,`shop_address`,`env_data`,`saler`,`custom`) values (4,126,1,'河蟹','20171219182358407_06066813.jpeg','河蟹','弓蟹科','2017-12-01',NULL,81,NULL,'河蟹养殖是指河蟹的养殖技术。河蟹是中国最重要的淡水蟹类，其肉质细嫩，味道鲜美，营养极为丰富，由于河蟹的适应性较强，养殖范围广，这几年养殖规模迅速增加，给养殖户带来了良好的经济效益。',2,1,'2017-12-19 18:23:59','2017-12-20 18:16:31','[{\"position\":\"1号稻田\",\"icon\":\"20171219173251514_57420320.jpeg\",\"desc\":\"插秧\\n将秧苗仔细的插进稻田中，间格有序。传统的插秧法会使用秧绳、秧标或插秧轮，来在稻田中做记号。手工插秧时，会在左手的大拇指上戴分秧器，帮助农人将秧苗分出，并插进土里。插秧的气候相当重要，如大雨则会将秧苗打坏。现代多有插秧机插秧，但在土地起伏大，形状不是方型的稻田中，还是需要人工插秧。秧苗一般会呈南北走向。还有更为便利的抛秧。\",\"chl\":\"90%\",\"type\":\"1\",\"picDate\":\"2017-12-08\",\"shl\":\"\"},{\"position\":\"1号稻田\",\"icon\":\"20171219173252475_22316936.jpeg\",\"desc\":\"秧苗成长的时候，得时时照顾，并拔除杂草、有时也需用农药来除掉害虫（如福寿螺）。\",\"chl\":\"\",\"type\":\"2\",\"picDate\":\"2017-12-14\",\"shl\":\"\"},{\"position\":\"1号稻田\",\"icon\":\"\",\"desc\":\"收成的稻谷需要干燥，过去多在三合院的前院晒谷，需时时翻动，让稻谷干燥。筛选则是将瘪谷等杂质删掉，用电动分谷机、风车或手工抖动分谷，利用风力将饱满有重量的稻谷自动筛选出来。\",\"chl\":\"\",\"type\":\"3\",\"picDate\":\"2017-12-30\",\"shl\":\"90%\"}]','{\"saleIcon\":\"\",\"buy\":\"12\",\"name\":\"鱼苗名称\",\"quality\":\"10kg\",\"factory\":\"鱼苗厂家\",\"hgzIcon\":\"20171220165723283_23525978.jpeg\",\"buyname\":\"隔壁老王11\",\"size\":\"1cm\"}','[{\"icon\":\"20171220164824115_08544037.jpeg\",\"rzBzDate\":\"2017-12-06\",\"rzEndDate\":\"2017-12-16\",\"rzType\":\"2\",\"rzNum\":\"ccc\",\"rzJg\":\"ccc\"}]','[{\"type\":\"1\",\"time\":\"2017-12-01\",\"size\":\"1\",\"quality\":\"1\",\"state\":\"1\",\"employee\":\"11\",\"employeename\":\"隔壁老王10\"},{\"type\":\"3\",\"time\":\"2017-12-06\",\"size\":\"2\",\"quality\":\"2\",\"state\":\"2\",\"employee\":\"10\",\"employeename\":\"隔壁老王9\"}]','[{\"time\":\"2017-12-01\",\"name\":\"饲料1\",\"factoryDate\":\"2017-12-15\",\"factory\":\"11111111\",\"buyDate\":\"2017-12-05\",\"type\":\"11防风网\",\"buyCnt\":\"10t\",\"outCnt\":\"5t\",\"inTmp\":\"15\",\"outTmp\":\"15\",\"employee\":\"12\",\"employeename\":\"隔壁老王11\"},{\"time\":\"2017-12-08\",\"name\":\"饲2\",\"factoryDate\":\"2017-12-13\",\"factory\":\"2\",\"buyDate\":\"2017-12-07\",\"type\":\"废物扔\",\"buyCnt\":\"0\",\"outCnt\":\"5t\",\"inTmp\":\"20\",\"outTmp\":\"20\",\"employee\":\"7\",\"employeename\":\"隔壁老王6\"}]','[{\"time\":\"2017-12-08\",\"name\":\"yimia\",\"factoryDate\":\"2017-12-15\",\"factory\":\"yimia1\",\"buyDate\":\"2017-12-08\",\"useCnt\":\"15\",\"reason\":\"预防\",\"check\":\"5\",\"deal\":\"8\",\"checkname\":\"隔壁老王4\",\"dealname\":\"隔壁老王7\"}]','[{\"time\":\"2017-12-14\",\"name\":\"药\",\"factoryDate\":\"2017-11-29\",\"factory\":\"111冯伟峰\",\"buyDate\":\"2017-12-14\",\"useCnt\":\"20\",\"reason\":\"生病\",\"check\":\"12\",\"deal\":\"6\",\"checkname\":\"隔壁老王11\",\"dealname\":\"隔壁老王5\"}]','1|2','3|4','31,36,37','81',NULL),(6,126,1,'中华鲟','20171221154009224_14164358.jpeg','鲟鱼','欧洲鲟','2017-12-21',NULL,81,NULL,'中华鲟（学名：Acipenser sinensis）：体长平均约40厘米，最长达130厘米，体重最高达600千克。[1]  体呈纺锤形，头尖吻长，口前有4条吻须，口位在腹面，有伸缩性，并能伸成筒状，体被覆五行大而硬的骨鳞，背面一行，体侧和腹侧各两行。鲟是一亿五千万年前中生代留下的稀有古代鱼类，它介于软骨与硬骨之间，骨骼的骨化程度普遍地减退，中轴为未骨化的弹性脊索，无椎体，随颅的软骨壳大部分不骨化。尾鳍为歪尾型，偶鳍具宽阔基部，背鳍与臀鳍相对。腹鳍位于背鳍前方，鳍及尾鳍的基部具棘状鳞，肠内具螺旋瓣，肛门和泄殖孔位于腹鳍基部附近，输卵管的开口与卵巢远离。\n夏秋两季，生活在长江口外浅海域的中华鲟回游到长江，历经3000多公里的溯流博击，才回到金沙江一带产卵繁殖。产后待幼鱼长大到15 厘米左右，又携带它们旅居外海。它们就这样世世代代在江河上游出生，在大海里生长。[2] \n中华鲟生命周期较长，最长寿命可达40龄。是中国一级重点保护野生动物，也是活化石，有“水中大熊猫”之称。具有很高的科研、药用和观赏价值。分布于中国、日本、韩国、老挝人民民主共和国和朝鲜。',1,1,'2017-12-21 15:40:09','2018-01-02 15:12:23','[{\"position\":\"123\",\"icon\":\"20180102134721824_09878835.jpeg\",\"desc\":\"图片描述\\t图片描述\\t图片描述\\t图片描述\\t图片描述\\t\",\"chl\":\"90%\",\"type\":\"1\",\"picDate\":\"2018-01-01\",\"shl\":\"\"}]','{\"saleIcon\":\"\",\"buy\":\"11\",\"name\":\"中华鲟\",\"quality\":\"5kg\",\"factory\":\"AAA\",\"hgzIcon\":\"\",\"buyname\":\"隔壁老王10\",\"size\":\"20cm\"}','[{\"icon\":\"20180102145817479_38381685.png\",\"rzBzDate\":\"2018-01-04\",\"rzEndDate\":\"2018-01-03\",\"rzType\":\"1\",\"rzNum\":\"00001\",\"rzJg\":\"1111\"}]','[{\"type\":\"1\",\"time\":\"2018-01-03\",\"size\":\"10cm\",\"quality\":\"10kg\",\"state\":\"良好\",\"employee\":\"9\",\"employeename\":\"隔壁老王8\"},{\"type\":\"3\",\"time\":\"2018-01-11\",\"size\":\"20cm\",\"quality\":\"20kg\",\"state\":\"不错\",\"employee\":\"4\",\"employeename\":\"隔壁老王3\"}]','[{\"time\":\"2018-01-03\",\"name\":\"SSS\",\"factoryDate\":\"2018-01-05\",\"factory\":\"1\",\"buyDate\":\"2018-01-11\",\"type\":\"A级\",\"buyCnt\":\"1\",\"outCnt\":\"1\",\"inTmp\":\"1\",\"outTmp\":\"1\",\"employee\":\"10\",\"employeename\":\"隔壁老王9\"}]','[{\"time\":\"2018-01-05\",\"name\":\"疫苗A\",\"factoryDate\":\"2018-01-04\",\"factory\":\"aaaa\",\"buyDate\":\"2018-01-10\",\"useCnt\":\"10mg\",\"reason\":\"附近的时空裂缝忌口了\",\"check\":\"9\",\"deal\":\"8\",\"checkname\":\"隔壁老王8\",\"dealname\":\"隔壁老王7\"}]','[{\"time\":\"2018-01-05\",\"name\":\"药品\",\"factoryDate\":\"2018-01-03\",\"factory\":\"丰盛的范德萨范德萨\",\"buyDate\":\"2018-01-18\",\"useCnt\":\"500g\",\"reason\":\"讽德诵功五个人\",\"check\":\"7\",\"deal\":\"6\",\"checkname\":\"隔壁老王6\",\"dealname\":\"隔壁老王5\"}]','123|456','11aaa|bbb','33,35,38','81','[]'),(7,126,1,'1','20171221151345953_57215098.jpeg','1','1','2017-12-01',NULL,81,NULL,'1',2,0,'2017-12-21 15:13:46','2017-12-21 15:13:46',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,126,1,'刀额新对虾','20180102155510902_32703161.jpeg','对虾','基围虾','2018-01-01',NULL,81,NULL,'属节肢动物门、甲壳纲、十足目、游泳亚目、对虾科。最大体长可达19cm。近岸浅海虾类，它具有杂食性强、广温、广盐和生长迅速、抗病害能力强等优点，而且能耐低氧，具有潜底习性。因壳薄体肥，肉嫩味美能活体销售而深受消费者青睐。是目前“海虾淡养”的优良品种。',1,1,'2018-01-02 15:55:11','2018-01-02 16:22:46','[{\"position\":\"1号鱼塘\",\"icon\":\"20180102160528420_98545493.jpeg\",\"desc\":\"稻田要求靠上下水渠近，水源充足，水质良好，排灌畅通，交通方便。面积以0.13-0.33公顷为好，最大不超过0.67公顷。在确定养虾的稻田四周或田内挖\\\"口\\\"、\\\"王\\\"字型环沟，沟深0.8-1米，宽1-1.5米，养虾沟占稻田面积的15%，从沟内取土加宽加高四周堤坝，稻田进排水口设置双层防逃网。\",\"chl\":\"99%\",\"type\":\"1\",\"picDate\":\"2018-01-01\",\"shl\":\"\"},{\"position\":\"1号鱼塘\",\"icon\":\"20180102160528543_14935894.png\",\"desc\":\"1、清田：对耕整完的田块，每0.067公顷施生石灰50-75公斤，杀死田中的野杂鱼和病菌等。\\n2、培育基础饵料：清田7-8天后，稻田水位稳定在5-10厘米，选择晴天上午每0.067公顷施有机肥200-300公斤；尿素3公斤，过磷酸钙5公斤，全池泼洒，以培育田中的生物饵料。\\n3、水稻的栽插：水稻应选用高产优质、耐肥、抗倒伏和病害少的品种，如辽研294。插秧方法同一般稻田，每0.067公顷穴数不少于15000棵。如5月20日插秧，5月30日秧苗已返青，6月1日至6月5日可开始投入虾苗。\",\"chl\":\"99%\",\"type\":\"1\",\"picDate\":\"2018-01-02\",\"shl\":\"\"},{\"position\":\"1号鱼塘\",\"icon\":\"20180102160529186_30302452.jpeg\",\"desc\":\"1、虾苗淡化：目前人工孵化基围虾苗种时海水比重为1.015-1.020。将虾苗移到稻田前，首先要用比重为1.002-1.003的水进行淡化\\n2、苗种质量：虾苗体长为0.7-0.8厘米，体质健壮，体表黄褐清洁整齐。供苗时，池内与外界水温温差不超过3℃\\n3、虾苗放养量及放养时间：每0.067公顷稻田放苗3万-4万尾。放苗时间：北方地区一般在6月上旬进行。\",\"chl\":\"\",\"type\":\"2\",\"picDate\":\"2018-01-03\",\"shl\":\"\"},{\"position\":\"1号鱼塘\",\"icon\":\"20180102160529291_87716633.jpeg\",\"desc\":\"一般在稻田中养殖90-110天即可生长到8-10厘米，正值水稻成熟季节，这时在收割前将虾收捕完后可以开镰收割，常用收捕方法有以下几种。\\n1、地笼收虾：在傍晚时将地笼下在稻田的养虾沟处，第2天早晨收笼。每0.067公顷可下25-30片笼。\\n2、拉网捕虾：将稻田水归入边沟，然后用小拉网在稻田沟内捕虾，一般拉网时间在傍晚进行。\\n3、干田放水收虾：水温在10-15℃时虾停止摄食和生长，这时可通过以上两种方法收捕，剩下数量不多时，可放干水后收捕。\",\"chl\":\"\",\"type\":\"3\",\"picDate\":\"2018-01-18\",\"shl\":\"80%\"}]','{\"saleIcon\":\"20180102160527612_23147097.jpeg\",\"buy\":\"11\",\"name\":\"基围虾苗\",\"quality\":\"91～110(只/kg）\",\"factory\":\"老兵水产专业繁育\",\"hgzIcon\":\"20180102160527480_16901586.jpeg\",\"buyname\":\"隔壁老王10\",\"size\":\"1（cm）\"}','[{\"icon\":\"20180102160717510_89814450.jpeg\",\"rzBzDate\":\"2018-01-02\",\"rzEndDate\":\"2019-01-03\",\"rzType\":\"8\",\"rzNum\":\"A0000001\",\"rzJg\":\"中国合格检测机构\"}]','[{\"type\":\"1\",\"time\":\"2018-01-01\",\"size\":\"3cm\",\"quality\":\"80g\",\"state\":\"良好\",\"employee\":\"11\",\"employeename\":\"隔壁老王10\"},{\"type\":\"1\",\"time\":\"2018-01-03\",\"size\":\"10cm\",\"quality\":\"100g\",\"state\":\"良好\",\"employee\":\"10\",\"employeename\":\"隔壁老王9\"},{\"type\":\"1\",\"time\":\"2018-01-04\",\"size\":\"12cm\",\"quality\":\"120g\",\"state\":\"良好\",\"employee\":\"0\",\"employeename\":\"\"}]','[{\"time\":\"2018-01-03\",\"name\":\"沼虾饲料\",\"factoryDate\":\"2017-12-31\",\"factory\":\"SSS\",\"buyDate\":\"2018-01-03\",\"type\":\"微颗粒饲料\",\"buyCnt\":\"1吨\",\"outCnt\":\"2kg\",\"inTmp\":\"25℃~30℃\",\"outTmp\":\"25℃~30℃\",\"employee\":\"11\",\"employeename\":\"隔壁老王10\"}]','[]','[]','https://detail.tmall.com/item.htm?spm=a220m.1000858.1000725.56.41f29800BuWRGy&id=547914853663&areaId=210200&user_id=3028244029&cat_id=2&is_b=1&rn=2917e4ef7f0e3c31e4771c6ab47f208f','','31,32','81','[]'),(9,126,2,'石斑鱼','20180202164040993_18641900.jpeg','暖水性礁栖鱼类','斜带石斑鱼','2018-01-02',NULL,81,NULL,'石斑鱼，属鲈形目，体长椭圆形稍侧扁。口大，具辅上颌骨，牙细尖，有的扩大成犬牙。体被小栉鳞，有时常埋于皮下。背鳍和臀鳍棘发达，尾鳍圆形或凹形，体色变异甚多，常呈褐色或红色，并具条纹和斑点，为暖水性的大中型海产鱼类。\n石斑鱼营养丰富，肉质细嫩洁白，类似鸡肉，素有“海鸡肉”之称。石斑鱼又是一种低脂肪、高蛋白的上等食用鱼，被港澳地区推为中国四大名鱼之一。',0,6,'2018-01-02 16:45:24','2018-02-02 16:40:41','[{\"position\":\"2号鱼塘\",\"icon\":\"20180202164041100_29715322.jpeg\",\"desc\":\"一般在孵化后的2～5天，属内源性营养与外源性营养共存阶段。此时投喂的外源性食物：小型浮游生物如原生动物、小型轮虫、牡蛎受精卵和幼体，及池塘中培育的藻类等和干性饵料如螺旋藻粉、虾片与发酵鱼粉等。\\n\\n这阶段螺旋藻粉、虾片等配合饵料一般要用200～250目的筛绢网过滤后才能投喂。一般第一天用250目筛绢网过滤，后两天用200目筛绢网过滤后投喂。1～2次/天，0.3～0.5ppm/次。\",\"chl\":\"97%\",\"type\":\"1\",\"picDate\":\"2018-01-03\",\"shl\":\"\"},{\"position\":\"2号鱼塘\",\"icon\":\"20180202164041255_69465554.jpeg\",\"desc\":\"生物饵料有藻类、轮虫及桡足类幼体。此阶段的生物饵料一般需经过120目的筛绢网过滤后投喂。\",\"chl\":\"\",\"type\":\"2\",\"picDate\":\"2018-01-06\",\"shl\":\"\"},{\"position\":\"2号鱼塘\",\"icon\":\"20180202164041370_25623198.jpeg\",\"desc\":\"发翅后至收翅前，此时鱼苗有延长的一条背鳍棘与左右各一条的腹鳍棘，形如风筝状，俗称发翅仔。\\n\\n这一时期的摄食由小型浮游动物向大型浮游动物转换，主要饵料有大轮虫、桡足类的幼体，约饲养5～7日后，鱼苗背鳍及左右腹鳍开始延长出长棘，且随时间增加而背鳍、左右腹鳍更加延长，形状类似飞鱼。\\n\\n此时水质控制相当重要，应尽量促持水质稳定，水色以保持淡绿色为佳，透明度60～80公分。\\n\\n本阶段末期可投喂挠足类成体，卤虫幼体等，约经15日腹鳍长棘收起，25日左右背棘长棘收起，称为“收翅”。\",\"chl\":\"\",\"type\":\"3\",\"picDate\":\"2018-02-01\",\"shl\":\"95%\"}]','{\"saleIcon\":\"\",\"buy\":\"0\",\"name\":\"石斑鱼苗\",\"quality\":\"0.01（公斤/尾）\",\"factory\":\"传杨水产2\",\"hgzIcon\":\"20180102164719797_07405135.jpeg\",\"buyname\":\"\",\"size\":\"3-5 cm\"}','[]','[]','[]','[]','[]','','','33,34,37,38','81','[]'),(10,126,1,'12121221','20180106174409526_48214090.jpeg','21212','121221','