螃蟹','20180202163840790_86314740.jpeg','231','32','2018-01-17',NULL,81,NULL,'现有标准化精养池塘1100亩，重点开展福瑞鲤、黄河鲤、中科3号等良种繁育；进行福瑞鲤、“中科3号”、丁桂、斑点叉尾鮰、南美白对虾、长丰鲢等名优新品种的引进养殖及销售。储备各类亲鱼5000余组，年生产各类优质苗种1.2亿尾、优质商品鱼750余吨。园区先后承担区、市、县多项科技攻关和开发项目，并在苗种繁殖、水产养殖、病害防治等方面取得了多项科技成果，是自治区渔业工程中心成员单位、科技厅5183科技项目参与单位和项目承担单位。公司先后被命名“全国优秀科普示范基地”和区、市级“渔业科技示范园区”及“区级农业产业化龙头企业”等称号。并成功注册了“贺蓝渔乡”、“塞上湖蟹”等商标。2013年公司自主研发的“手机短信遥控智能化养鱼设备”和“手机短信遥控智能化蔬菜大棚智能控制设备”被国家知识产权局授予专利权；完成的“福瑞鲤扩繁及高效养殖”项目获全国农牧渔业丰收二等奖,2014年被中国水科院淡水渔业研究中心授予“国家水产新品种福瑞鲤银川扩繁基地”。',1,2,'2018-01-20 16:29:05','2018-02-02 16:43:56','[{\"position\":\"\",\"icon\":\"20180202163840934_00150263.jpeg\",\"desc\":\"\",\"chl\":\"\",\"type\":\"1\",\"picDate\":\"\",\"shl\":\"\"}]','{\"saleIcon\":\"\",\"buy\":\"0\",\"name\":\"\",\"quality\":\"\",\"factory\":\"\",\"hgzIcon\":\"\",\"buyname\":\"\",\"size\":\"\"}','[]','[]','[]','[]','[]','','','','','[]'),(25,112,1,'草鱼','20180606125036507_32617662.jpeg','草鱼','草鱼','2018-03-30',NULL,78,NULL,'草鱼属鲤形目鲤科雅罗鱼亚科草鱼属。草鱼的俗称有:鲩、鲩鱼、油鲩、草鲩、白鲩、草鱼、草根(东北)、厚子鱼(鲁南)、海鲩(南方)、混子、黑青鱼等。英文名:Grass carp 。栖息于平原地区的江河湖泊，一般喜居于水的中下层和近岸多水草区域。性活泼，游泳迅速，常成群觅食。为典型的草食性鱼类。草鱼幼鱼期则食幼虫，藻类等，草鱼也吃一些荤食，如蚯蚓，蜻蜓等。在干流或湖泊的深水处越冬。生殖季节亲鱼有溯游习性。已移殖到亚、欧、美、非各洲的许多国家。因其生长迅速，饲料来源广，是中国淡水养殖的四大家鱼之一。',0,0,'2018-06-06 12:50:36','2018-06-06 12:50:36',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(26,112,2,'草鱼','20180606125131460_18778556.jpeg','草鱼','草鱼','2018-03-30',NULL,78,NULL,'草鱼属鲤形目鲤科雅罗鱼亚科草鱼属。草鱼的俗称有:鲩、鲩鱼、油鲩、草鲩、白鲩、草鱼、草根(东北)、厚子鱼(鲁南)、海鲩(南方)、混子、黑青鱼等。英文名:Grass carp 。栖息于平原地区的江河湖泊，一般喜居于水的中下层和近岸多水草区域。性活泼，游泳迅速，常成群觅食。为典型的草食性鱼类。草鱼幼鱼期则食幼虫，藻类等，草鱼也吃一些荤食，如蚯蚓，蜻蜓等。在干流或湖泊的深水处越冬。生殖季节亲鱼有溯游习性。已移殖到亚、欧、美、非各洲的许多国家。因其生长迅速，饲料来源广，是中国淡水养殖的四大家鱼之一。',0,0,'2018-06-06 12:51:31','2018-06-06 12:51:31',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(27,112,3,'草鱼','20180606125202196_02097729.jpeg','草鱼','草鱼','2018-03-29',NULL,78,NULL,'草鱼属鲤形目鲤科雅罗鱼亚科草鱼属。草鱼的俗称有:鲩、鲩鱼、油鲩、草鲩、白鲩、草鱼、草根(东北)、厚子鱼(鲁南)、海鲩(南方)、混子、黑青鱼等。英文名:Grass carp 。栖息于平原地区的江河湖泊，一般喜居于水的中下层和近岸多水草区域。性活泼，游泳迅速，常成群觅食。为典型的草食性鱼类。草鱼幼鱼期则食幼虫，藻类等，草鱼也吃一些