/*Table structure for table `t_g_data_collection` */

CREATE TABLE `t_g_data_collection` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL COMMENT '企业id',
  `ground_num` int(11) NOT NULL COMMENT '大棚编号',
  `device_id` int(11) NOT NULL COMMENT '设备id',
  `data` decimal(11,2) DEFAULT NULL COMMENT '数据',
  `year` int(11) NOT NULL COMMENT '年',
  `year_date` int(11) NOT NULL COMMENT '日期',
  `year_date_hour` int(11) NOT NULL COMMENT '日期小时(方便统计)',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `ground_num` (`ground_num`)
) ENGINE=InnoDB AUTO_INCREMENT=1416914 DEFAULT CHARSET=utf8 COMMENT='大棚-数据采集表';

