insert  into `t_g_source`(`id`,`company_id`,`ground_num`,`product_name`,`product_icon`,`product_detail`,`product_type`,`plant_time`,`season`,`employee_id`,`remarks`,`product_information`,`state`,`batch_count`,`create_time`,`update_time`,`growth_pic`,`fertilization_rec`,`pesticide_rec`,`farming_rec`,`auth_info`,`growing_cycles`,`seed_source`,`web_links`,`shop_address`,`fertilizer`,`env_data`,`drug`,`saler`,`custom`) values (15,126,1,'苹果','20180120213237130_70206660.jpeg','苹果','苹果','2018-01-20','1',81,NULL,'苹果',1,1,'2018-01-20 21:32:37','2018-01-20 21:36:37','[{\"position\":\"贺兰山黄土高坡\",\"icon\":\"20180120213636846_66648647.jpeg\",\"desc\":\"这长的真不错\",\"picDate\":\"2018-01-17\"}]','[{\"fzDate\":\"2018-01-23\",\"fzName\":\"羊粪\",\"fzType\":\"钾\",\"fzCnt\":\"1000g\",\"fzPp\":\"xx\",\"fzGys\":\"xx\"}]','[{\"drugDate\":\"2018-01-18\",\"drugName\":\"xx\",\"drugCnt\":\"xx\",\"drugPp\":\"xx\",\"drugGys\":\"xx\"}]','[]','[]','{\"sowingDate\":\"2018-01-10\",\"ymchl\":\"苹果\",\"ggDate\":\"2018-01-19\",\"csDate\":\"2018-01-25\",\"recvDate\":\"2018-01-25\",\"ggl\":\"10%\",\"hfcll\":\"2%\",\"recordDate\":\"2018-01-26\",\"recordEmployee\":\"76\",\"recordEmployeename\":\"李文慧\"}','{\"hgz\":\"20180120213636939_07017093.jpeg\",\"buyEmployeename\":\"76\",\"buyEmployee\":\"76\",\"name\":\"一直都在地里\",\"outDate\":\"2018-01-23\",\"cj\":\"农户\",\"buyDate\":\"2018-01-17\",\"type\":\"1\",\"zjy\":\"20180120213637324_55693809.jpeg\",\"sale\":\"20180120213637017_74964327.jpeg\"}','www.baidu.com','www.baidu.com','{\"soilInfo\":\"好\",\"soilCheckEmployee\":\"76\",\"soilFzEmployee\":\"76\",\"soilCheckEmployeename\":\"李文慧\",\"soilFzEmployeename\":\"李文慧\"}','1,2,3,4','{\"drugReason\":\"xx\",\"drugCheckEmployee\":\"76\",\"drugDealEmployee\":\"76\",\"drugTime\":\"2018-01-18\",\"drugCheckEmployeename\":\"李文慧\",\"drugDealEmployeename\":\"李文慧\"}','81','[]'),(16,126,1,'草莓','20180131161452350_95685146.jpeg','草莓','草莓','2018-01-24','1',81,NULL,'草莓又叫红莓、地莓等，它的外观呈心形，鲜美红嫩，果肉多汁，酸甜可口，香味浓郁，不仅有色彩，而且还有一般水果所没有的宜人的芳香，是水果中难得的色、香、味俱佳者，因此常被人们誉为“果中皇后”。草莓的营养成分容易被人体消化、吸收，多吃也不会受凉或上火，是老少皆宜的健康食品。草莓中所含的胡萝卜素是合成维生素A的重要物质，具有明日养肝作用。它还含有果胶和丰富的膳食纤维，可以帮助消化、通畅大便。草莓对胃肠道和贫血均有一定的滋补调理作用。草莓除可以预防坏血病外，对防治动脉硬化、冠心病也有较好的功效。草莓是鞣酸含量丰富的植物，在体内可吸附和阻止致癌化学物质的吸收，具有防癌作用。美国把草莓列入十大美容食品。据研究，女性常吃草莓，对皮肤、头发均有保健作用。草莓在德国被誉为“神奇之果”。草莓还可以减肥，因为它含有一种叫天冬氨酸的物质，可以自然而平缓地除去体内的“矿渣”。祖国医学认为，草莓性凉味酸，具有润肺生津、清热凉血、健脾解酒等功效。闲暇时，您不妨走出钢筋水泥的禁锢，来到我的绿色田园。带上家人、邀上知己，到我的草莓园里转上一圈儿。亲自了解一下草莓是怎样开花、结果的。用相机记录下挚爱的人正在采摘的瞬间。在这里，您可以享受春季的温馨、采摘的乐趣!适合人群：老少皆宜。\n\n',1,4,'2018-01-20 21:46:50','2018-02-01 14:36:19','[{\"position\":\"贺兰县\",\"icon\":\"20180131161452805_57802210.jpeg\",\"desc\":\"\",\"picDate\":\"2018-01-05\"},{\"position\":\"\",\"icon\":\"20180201143618331_42615152.jpeg\",\"desc\":\"\",\"picDate\":\"\"},{\"position\":\"\",\"icon\":\"20180201143618613_09417800.jpeg\",\"desc\":\"\",\"picDate\":\"\"},{\"position\":\"\",\"icon\":\"20180201143618779_34058276.jpeg\",\"desc\":\"\",\"picDate\":\"\"},{\"position\":\"\",\"icon\":\"20180201143618962_22020611.jpeg\",\"desc\":\"\",\"picDate\":\"\"}]','[]','[]','[]','[]','{\"sowingDate\":\"2018-01-01\",\"ymchl\":\"90%\",\"ggDate\":\"2018-05-10\",\"csDate\":\"2018-06-30\",\"recvDate\":\"2018-06-30\",\"ggl\":\"90%\",\"hfcll\":\"0\",\"recordDate\":\"2018-05-31\",\"recordEmployee\":\"0\",\"recordEmployeename\":\"\"}','{\"hgz\":\"\",\"buyEmployeename\":\"\",\"chl\":\"\",\"buyEmployee\":\"0\",\"name\":\"草莓幼苗\",\"cj\":\"天源种业\",\"type\":\"2\",\"zjy\":\"\",\"sale\":\"\",\"size\":\"5cm\"}','','精品农业超市专柜','{\"soilInfo\":\"\",\"soilCheckEmployee\":null,\"soilFzEmployee\":null,\"soilCheckEmployeename\":\"\",\"soilFzEmployeename\":\"\"}','1,2,3,4,5,6,7','{\"drugReason\":\"\",\"drugCheckEmployee\":null,\"drugDealEmployee\":null,\"drugTime\":\"\",\"drugCheckEmployeename\":\"\",\"drugDealEmployeename\":\"\"}','81','[]'),(17,126,3,'苹果','20180209140408943_67441651.jpeg','sdf','sdf','2018-02-09','1',81,NULL,'',1,0,'2018-02-09 14:04:09','2018-02-09 14:04:09',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(18,126,1,'太阳','2018