/*Table structure for table `t_s_batch` */

CREATE TABLE `t_s_batch` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL COMMENT '公司id',
  `user_type` int(11) NOT NULL COMMENT '类型0农业 1渔业 2大田',
  `product_id` int(11) NOT NULL COMMENT '产品id',
  `listed_time` date DEFAULT NULL COMMENT '上市时间',
  `quota_desc` varchar(2000) DEFAULT NULL COMMENT '指标描述',
  `testing_rec` text COMMENT '检测记录，json',
  `machining_rec` text COMMENT '加工记录，json',
  `distribute_rec` text COMMENT '分配记录，json',
  `barcode` varchar(50) DEFAULT NULL COMMENT '条形码',
  `barcode_url` varchar(300) DEFAULT NULL COMMENT '条形码图片',
  `qrcode_url` varchar(300) DEFAULT NULL COMMENT '二维码图片',
  `is_review` char(1) DEFAULT '0' COMMENT '是否审核,1通过，0不通过',
  `is_shelve` char(1) DEFAULT '1' COMMENT '是否上架，1上架，0下架',
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  `is_del` int(11) NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`),
  KEY `barcode` (`barcode`)
) ENGINE=InnoDB AUTO_INCREMENT=129 DEFAULT CHARSET=utf8 COMMENT='溯源-批次表';

