开展农业环境类的检验。主要包括土壤环境类、农田灌溉水质、畜禽应用水质、环境空气质量、蔬菜产地条件、水稻产地条件、柑橘产地条件、茶叶产地条件8类参数检测资质。  2.3开展肥料类得检测。包括有机肥料和复混肥料两类参数检测资质','[]','[]','[]','2017122718049123','br_2017122718049123.png','qr_2017122718049123.png','0','1','2017-12-27 18:04:14','2017-12-29 09:37:45',0),(43,126,1,8,'2018-01-06','鲜虾产品共抽检20批次，依据《GB2733-2005 鲜、冻动物性水产品卫生标准》、卫生部《食品中可能违法添加的非食用物质和易滥用的食品添加剂名单（第四批）>》（整顿办函[2010]50号）和《动物性食品中兽药最高残留限量》(农业部2002年235号公告)，检测项目设定了腐败变质指标挥发性盐基氮，违法添加焦亚硫酸钠共2个项目。20批次样品全部符合标准要求，合格率为100%。','[{\"icon\":\"20180102161021638_78673972.jpeg\",\"detail\":[{\"quota\":\"31\",\"value\":\"0.01%\"},{\"quota\":\"33\",\"value\":\"0.02%\"}],\"tester\":\"11\",\"time\":\"2018-01-02\",\"organ\":\"检测机构\",\"type\":\"31\"},{\"icon\":\"20180102161021781_68056633.jpeg\",\"detail\":[{\"quota\":\"51\",\"value\":\"0.02\"}],\"tester\":\"11\",\"time\":\"2018-01-03\",\"organ\":\"检测机构B\",\"type\":\"33\"}]','[]','[{\"time\":\"2018-01-20\",\"destination\":\"北京市\",\"distributor\":\"11\",\"distributorname\":\"隔壁老王10\"},{\"time\":\"2018-01-20\",\"destination\":\"辽宁省大连市\",\"distributor\":\"8\",\"distributorname\":\"隔壁老王7\"}]','2018010216109139','br_2018010216109139.png','qr_2018010216109139.png','0','1','2018-01-02 16:10:22',NULL,0),(44,126,1,9,'2018-02-10','1111111','[]','[]','[]','2018010216513087','br_2018010216513087.png','qr_2018010216513087.png','0','1','2018-01-02 16:51:36',NULL,0),(45,126,1,9,'2018-01-06','1','[{\"icon\":\"20180106143749973_72769099.jpeg\",\"detail\":[{\"quota\":\"31\",\"value\":\"1\"}],\"tester\":\"10\",\"time\":\"2018-01-06\",\"organ\":\"1\",\"type\":\"31\"}]','[]','[]','2018010614374101','br_2018010614374101.png','qr_2018010614374101.png','0','1','2018-01-06 14:37:50',NULL,0),(46,126,1,9,'2018-01-25','11111111','[]','[]','[]','2018010614388733','br_2018010614388733.png','qr_2018010614388733.png','0','1','2018-01-06 14:38:06',NULL,0),(47,126,1,11,'2018-01-11','12','[]','[]','[]',NULL,NULL,NULL,'0','1','2018-01-06 17:44:44',NULL,0),(50,126,1,9,'2018-01-09','2132','[{\"icon\":\"20180117103233947_85510