/*Table structure for table `t_t_data_collection` */

CREATE TABLE `t_t_data_collection` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL COMMENT '企业id',
  `datian_num` int(11) NOT NULL COMMENT '大田编号',
  `device_id` int(11) NOT NULL COMMENT '设备id',
  `data` decimal(10,2) DEFAULT NULL COMMENT '数据',
  `year` int(11) NOT NULL,
  `year_date` int(11) DEFAULT NULL,
  `year_date_hour` int(11) NOT NULL,
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `company_id` (`company_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='大田-数据采集表';

/*Data for the table `t_t_data_collection` */

/*Table structure for table `t_t_source` */

CREATE TABLE `t_t_source` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `company_id` int(11) NOT NULL COMMENT '企业id',
  `datian_num` int(11) NOT NULL COMMENT '大棚编号',
  `product_name` varchar(200) NOT NULL COMMENT '产品名称',
  `product_icon` varchar(200) DEFAULT NULL COMMENT '产品图片',
  `product_detail` varchar(200) NOT NULL COMMENT '种养产品',
  `product_type` varchar(200) NOT NULL COMMENT '品种',
  `plant_time` date NOT NULL COMMENT '种养时间',
  `season` char(1) NOT NULL DEFAULT '1' COMMENT '种养季次，1,2,3,4',
  `employee_id` int(11) DEFAULT NULL COMMENT '负责人',
  `remarks` varchar(200) DEFAULT NULL COMMENT '备注',
  `product_information` varchar(2000) DEFAULT NULL COMMENT '产品简介',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '0种植 1归档  2删除',
  `batch_count` int(11) NOT NULL DEFAULT '0' COMMENT '批次',
  `create_time` datetime NOT NULL COMMENT '档案创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '档案修改时间',
  `growth_pic` text COMMENT '生长期图片',
  `fertilization_rec` text COMMENT '施肥记录',
  `pesticide_rec` text COMMENT '用药记录',
  `web_links` varchar(500) DEFAULT NULL COMMENT '网店链接',
  `shop_address` varchar(500) DEFAULT NULL COMMENT '实体店地址',
  `env_data` text COMMENT '环境数据',
  `saler` varchar(200) DEFAULT NULL COMMENT '售卖人id',
  `custom` text COMMENT '自定义模块',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='大田-溯源表';

/*Data for the table `t_t_source` */

insert  into `t_t_source`(`id`,`company_id`,`datian_num`,`product_name`,`product_icon`,`product_detail`,`product_type`,`plant_time`,`season`,`employee_id`,`remarks`,`product_information`,`state`,`batch_count`,`create_time`,`update_time`,`growth_pic`,`fertilization_rec`,`pesticide_rec`,`web_links`,`shop_address`,`env_data`,`saler`,`custom`) values (1,126,1,'小麦','20180120213237130_70206660.jpeg','小麦A','小麦B','2018-08-08','2',81,'备注信息无','麦子，单子叶植物，禾本科。一年生或二年生草本植物。茎秆中空，有节。叶长披针形。穗状花序称“麦穗”，小穗两侧扁平，有芒或无芒。颖果即麦粒。按播种期分冬小麦和春小麦。',1,0,'2018-08-19 00:00:00','2018-08-19 00:00:00','[{\"position\":\"贺兰山黄土高坡\",\"icon\":\"20180120213636846_66648647.jpeg\",\"desc\":\"这长的真不错\",\"picDate\":\"2018-01-17\"}]','[{\"fzDate\":\"2018-01-23\",\"fzName\":\"羊粪\",\"fzType\":\"钾\",\"fzCnt\":\"1000g\",\"fzPp\":\"xx\",\"fzGys\":\"xx\"}]','[{\"drugDate\":\"2018-01-18\",\"drugName\":\"xx\",\"drugCnt\":\"xx\",\"drugPp\":\"xx\",\"drugGys\":\"xx\"}]','www.taobao.com','lalal','200,201,202,203,204','81',NULL),(2,126,1,'玉米','20180120213237130_70206660.jpeg','玉米A','玉米B','2018-08-08','2',81,'1111','玉米味道香甜，可做各式菜肴，如玉米烙、玉米汁等，它也是工业酒精和烧酒的主要原料。',0,1,'2018-08-19 00:00:00','2018-08-19 00:00:00','[{\"position\":\"贺兰山黄土高坡\",\"icon\":\"20180120213636846_66648647.jpeg\",\"desc\":\"这长的真不错\",\"picDate\":\"2018-01-17\"}]','[{\"fzDate\":\"2018-01-23\",\"fzName\":\"羊粪\",\"fzType\":\"钾\",\"fzCnt\":\"1000g\",\"fzPp\":\"xx\",\"fzGys\":\"xx\"}]','[{\"drugDate\":\"2018-01-18\",\"drugName\":\"xx\",\"drugCnt\":\"xx\",\"drugPp\":\"xx\",\"drugGys\":\"xx\"}]','www.taobao.com','lalal','200,201,202,203,204','81',NULL),(3,126,2,'棉花','20180120213237130_70206660.jpeg','棉花1','棉花2','2018-08-08','2',81,NULL,'棉花，是锦葵科（Malvaceae）棉属（Gossypium）植物的种籽纤维，原产于亚热带。植株灌木状，在热带地区栽培可长到6米高，一般为1到2米。',1,1,'2018-08-19 00:00:00','2018-08-31 14:07:02','[{\"picDate\":\"2018-01-17\",\"icon\":\"20180120213636846_66648647.jpeg\",\"position\":\"贺兰山黄土高坡\",\"desc\":\"这长的真不错\"}]','[{\"fzDate\":\"2018-01-23\",\"fzName\":\"羊粪\",\"fzType\":\"钾\",\"fzCnt\":\"1000g\",\"fzPp\":\"xx\