/*Table structure for table `t_user` */

CREATE TABLE `t_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mobile` varchar(50) NOT NULL COMMENT '手机号',
  `name` varchar(50) NOT NULL COMMENT '企业名称',
  `type` int(11) NOT NULL COMMENT '1:超级管理员 2管理员 3:农业 4:渔业',
  `max_cnt` int(11) NOT NULL COMMENT '大棚/鱼塘数',
  `icon` varchar(200) NOT NULL DEFAULT 'icon_default.jpg' COMMENT '企业照片',
  `describe` varchar(2000) DEFAULT NULL COMMENT '企业简介',
  `lng` varchar(100) DEFAULT NULL COMMENT '经度位置',
  `lat` varchar(100) DEFAULT NULL COMMENT '纬度位置',
  `contacts` varchar(50) DEFAULT NULL COMMENT '联系方式',
  `address` varchar(500) DEFAULT NULL COMMENT '地址',
  `camera_url` varchar(200) DEFAULT NULL COMMENT '摄像机IP地址',
  `camera_port` varchar(50) DEFAULT NULL COMMENT '摄像机端口',
  `phone_port` varchar(50) DEFAULT NULL COMMENT '手机端端口',
  `camera_uname` varchar(100) DEFAULT NULL COMMENT '摄像机用户名',
  `camera_pwd` varchar(100) DEFAULT NULL COMMENT '摄像机密码',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '0禁用 1可用',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `update_time` datetime NOT NULL COMMENT '修改时间',
  `contacts_user` varchar(200) DEFAULT NULL COMMENT '联系人',
  `push_state` int(11) NOT NULL DEFAULT '1' COMMENT '是否开启推送',
  `default_pwd` varchar(50) NOT NULL COMMENT '默认密码',
  `exception_mobile` varchar(50) DEFAULT NULL COMMENT '异常报警电话',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=900002 DEFAULT CHARSET=utf8 COMMENT='用户账号表';

