/*Table structure for table `w_inventory` */

CREATE TABLE `w_inventory` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '产品ID',
  `name` varchar(200) NOT NULL COMMENT '产品名称',
  `type` varchar(200) NOT NULL COMMENT '产品种类',
  `size` varchar(200) NOT NULL COMMENT '入库|出库 量',
  `stock` varchar(200) DEFAULT NULL COMMENT '库存（当入库时，该字段标识有多少剩余库存）',
  `qualified` varchar(20) DEFAULT NULL COMMENT '合格率',
